import React from "react";
import Carousel from "react-material-ui-carousel";
import { Paper, Button } from "@material-ui/core";
function MyCarousel(props) {
  var items = [
    {
      hinhAnh: "http://movie0706.cybersoft.edu.vn/hinhanh/kieu_gp09.jpeg",
      alt: "Img alt",
    },
    {
      hinhAnh:
        "http://movie0706.cybersoft.edu.vn/hinhanh/the-secret-garde_gp09.jpg",
      alt: "Img alt",
    },
    {
      hinhAnh:
        "http://movie0706.cybersoft.edu.vn/hinhanh/radioactive-2_gp09.jpg",
      alt: "Img alt",
    },
    {
      hinhAnh: "http://movie0706.cybersoft.edu.vn/hinhanh/da-5-bloods_gp09.jpg",
      alt: "Img alt",
    },
  ];

  return (
    <Carousel>
      {items.map((item, i) => (
        <Item key={i} item={item} />
      ))}
    </Carousel>
  );
}

function Item(props) {
  return (
    <Paper>
      <img src={item.hinhAnh} alt={item.alt} />

      <Button className="CheckButton">Check it out!</Button>
    </Paper>
  );
}

export default MyCarousel;
